import React, { useEffect, useState } from 'react';
import './App.css';


interface Product {
  "id": string;
  "type": "gloves" | "beanies" | "facemasks";
  "name": string;
  "color": [];
  "price": number;
  "manufacturer": "hennex" | "ippal" | "juuran" | "niksleh" | "abiplos" | "umpante";
}

function App() {
  const [gloves, setGloves] = useState<Product[] | null>(null);

  const fetchGloves = async () => {
    const glovesRes = await fetch('http://example.com/movies.json');
    const glovesJson = await glovesRes.json();
    setGloves(glovesJson);
  }


  useEffect(() => {
    fetchGloves();
  }, []);

  return (
    <div className="App">
      <div className="content">
        <div onClick={() => fetchGloves()}>{'Gloves'}</div>
        <div>{'Beanies'}</div>
        <div>{'Face masks'}</div>
      </div>
    </div>
  );
}

export default App;
